import React from 'react'
import { Modal, ModalBody, ModalFooter, ModalHeader, Button } from 'reactstrap'
//import axios from 'axios'
//import apiconfig from '../../../configs/api.config.json'

class ViewJurusan extends React.Component {
    render(){
        return(
            <Modal isOpen={this.props.view} className={this.props.className}>
                <ModalHeader> View Jurusan</ModalHeader>
                <ModalBody >
                <form class="form-inline">
                    <div class ="input-group mb-3 input-group-sm">
                        <label for="text"> *Id Jurusan: </label>
                        <input type="text" class="form-control" readOnly
                        name="id" 
                        //value={this.props.jurusan.id} 
                        onChange={this.changeHandler} />
                        <label for="text"> *Kode Jurusan: </label>
                        <input type="text" class="form-control" placeholder="Type Jurusan" readOnly
                        name="kode" 
                        //value={this.props.jurusan.kode} 
                        onChange={this.changeHandler} />
                    </div>

                    <div class ="input-group mb-3 input-group-sm">
                        <label for="text"> *Nama Jurusan: </label>
                        <input type="text" class="form-control" readOnly
                        name="nama" 
                        //value={this.props.jurusan.nama} 
                        onChange={this.changeHandler} />
                    </div>

                </form>
                </ModalBody>
                <ModalFooter>
                    <Button color="danger" onClick={this.props.closeModalHandler}>Close</Button>
                </ModalFooter>
            </Modal>
        )
    }
}
export default ViewJurusan
